import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Button, PointPropType, Image, TouchableOpacity, FlatList, ScrollView } from 'react-native';
import { MaterialCommunityIcons } from '@expo/vector-icons'; 
import { AntDesign } from '@expo/vector-icons';  
import { createNativeStackNavigator } from '@react-navigation/native-stack';
export default function trangchu({ navigation }) {
    return (
        <View atyle={styles.container}>
            <Text style={styles.text}> Trang Chá»§ </Text>
            <View style={styles.thanhtren}>
                <View style={styles.iconmess}>
                <MaterialCommunityIcons name="email-outline" size={24} color="black" />
                <AntDesign name="search1" size={24} color="black" />
                </View>
                <View style={styles.logocanifa}>
                <Image
                    style={styles.logoha}
                    source={require("./image/logocanifa.jpg")}
                />
                </View>
            </View>

        </View>
    );
}
const Stack = createNativeStackNavigator();

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
    },

    text: {
        marginTop: 10,
        fontSize: 24,
        fontWeight: 'bold',
        color: '#635555',
        marginLeft: 5,
    },
logoha: {
    width:150,
    height:80,
}

});
